import React, { FC, useState } from "react";
import { ReactSortable } from "react-sortablejs-typescript";

interface ItemType {
    id: string;
    title: string;
}

const TodoList = ({props}) => {
    const [state, setState] = useState<ItemType>([
        {id:'alkj', title:'title1'},
        {id:'kdks', title:'title2'},
        {id:'iekd', title:'title1'},
        {id:'dkht', title:'title1'}
    ]);
    return(
        <div className="alert alert-warning pl-3">
            <ReactSortable list={state} setList={setState}>{
                props.map(element => {
                    const {id, ...elem} = element;
                    return(
                        <li style ={{listStyleType:"none"}}key={id} className="pl-5">
                            <TodoItem {...elem}></TodoItem>
                        </li>
                    )
                })
            }</ReactSortable>
        </div>
    )
    /* return (
